import React from 'react';

const Form = () => {
    return(
        <form>
            <input type='text' className='todo-input'>tehtävä</input>
            <button className='todo-button' type='submit'><i className= 'fas-neliö'></i>
            </button>
            <div className='select'>
                <select name='todos' className='fialter-todo'>
                    <option value='all'>Kaikki</option>
                    <option value='completed'>Tehdyt</option>
                    <option value='uncompleted'>Tekemättä</option>
                </select>
            </div>
        </form>
    );
}
export default Form;
